                                    <h5 className="card-title">{blog.blogtitle}</h5>
                                    <p className="card-text">{blog.blogcontent}</p>
                                    <div className="controls">
                                        <button onClick={editpost} type="button" className="btn btn-primary">Edit</button>
                                        <button onClick={replypost} type="button" className="btn btn-secondary">Reply</button>
                                        <button onClick={() => deletepost(blog._id)} type="button" className="btn btn-danger">Delete</button>
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div> */}


<div class="blogs">
{status === "ok" && blogs.map(blog => (
        <div class="card">
            <div class="card-body">
              <h3 class="card-title">{blog.username}</h3>
              <p class="card-text blogdate">{blog.blogtitle}</p>
              <p class="card-text">{blog.blogcontent}</p>
              <div class="controlbtn">
              <form action="" method="post">
                <button type="submit" class="btn btn-secondary">Delete</button>
              </form>
              <a href="" class="btn btn-success">Read</a>
              <a href="" class="btn btn-secondary">Edit</a>
            </div>
          </div>
        </div>
     ))}
  </div>





